import styled from "styled-components";
import Logo from "../components/Logo";
import { Link } from "react-router-dom";
import Inputs from "../constants/Inputs";
import { useState } from "react";

export default function Cadastro(){
    
    const [email,setEmail]=useState(" ");
    const [senha,setSenha]=useState(" ");
    const [nome,setNome]=useState(" ");
    const [foto,setFoto]=useState(" ");

    return (
        <>
            <Logo />
            <Wrapper>
                <Inputs type="text" placeholder={"email"} onChange={(e)=> setEmail(e.target.value)} />
                <Inputs type="text" placeholder={"senha"} onChange={(e)=>setSenha(e.target.value)} />
                <Inputs type="text" placeholder={"nome"} onChange={(e)=>setNome(e.target.value)} />.
                <Inputs type="text" placeholder={"foto"} onChange={(e)=> setFoto(e.target.value)} />
                <Botão>Entrar</Botão>
                <Link to={`/`}>
                    <Cadastrado>Já tem uma conta? Faça login!</Cadastrado>
                </Link>
            </Wrapper>
        </>
    )
}

const Wrapper=styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
`

const Email = styled.div`
    margin-bottom: 10px;
    box-sizing: border-box;
    width: 303px;
    height: 45px;
    background: #FFFFFF;
    border: 1px solid #D5D5D5;
    border-radius: 5px;
    display: flex;
    align-items: center;
    justify-content: flex-start;
    color: #DBDBDB;
    padding: 15px;
`
const Senha= styled.div`
    color:#DBDBDB;
    margin-bottom: 10px;
    box-sizing: border-box;
    width: 303px;
    height: 45px;
    background: #FFFFFF;
    border: 1px solid #D5D5D5;
    border-radius: 5px;
    display: flex;
    align-items: center;
    justify-content: flex-start;
    padding: 15px;
`

const Nome= styled.div`
    color:#DBDBDB;
    margin-bottom: 10px;
    box-sizing: border-box;
    width: 303px;
    height: 45px;
    background: #FFFFFF;
    border: 1px solid #D5D5D5;
    border-radius: 5px;
    display: flex;
    align-items: center;
    justify-content: flex-start;
    padding: 15px;
`
const Foto= styled.div`
    color:#DBDBDB;
    margin-bottom: 10px;
    box-sizing: border-box;
    width: 303px;
    height: 45px;
    background: #FFFFFF;
    border: 1px solid #D5D5D5;
    border-radius: 5px;
    display: flex;
    align-items: center;
    justify-content: flex-start;
    padding: 15px;
`

const Botão=styled.div`
	color: white;
	background: #52B6FF;
	border-radius: 5px;
    width: 303px;
    height: 45px;
    display: flex;
    align-items: center;
    justify-content: center;
    text-align: center;
`

const Cadastrado=styled.div`
    font-family: 'Lexend Deca';
    font-style: normal;
    font-weight: 400;
    font-size: 13.976px;
    line-height: 17px;
    text-align: center;
    text-decoration-line: underline;
    color: #52B6FF;
    margin-top: 30px;
`
